import React from 'react';
import { Router, BrowserRouter, Switch, Route } from 'react-router-dom';
import { Dashboard } from './pages/Dashboard';

function App() {
  return (
    <div>

      <Router>
        <Switch>
          <Route path="/" component={Dashboard} />
        </Switch>
      </Router>

    </div>
  );
}

export default App;
